import Link from "next/link";
import { motion } from "framer-motion";

export default function Home() {
  return (
    <div className="mb-20">
      <motion.h1 layoutId="header" className="font-custom3 text-7xl">My projects</motion.h1>
      <div className="mt-50 container flex flex-row justify-around">
        {[{name: "midori", color: "blue"}, {name: "shareit", color: ""}].map((product) => (
          <Link href={product}>
            <a>
              <motion.img
                layoutId={product.name}
                className={`object-cover border rounded ${"shadow-sm" + product.color} mr-10 w-1/2`}
                src={product.name + ".png"}
                animate={{ scale: 1 }}
                whileHover={{ scale: 1.1 }}
              />

            </a>
          </Link>
        ))}
      </div>
    </div>
  );
}
